if mibBuilder.loadTexts: sub10UnitMgmtAlarmTable.setDescription("The sub10UnitMgmtAlarmTable defines the alarm configuration. The first 'N' rows of the table is reserved for fixed alarms defined by the manufacturer. Fixed alarms cannot be deleted or their names changed, other attributes of a fixed alarm may be modified. The remainder of rows are available for user defined alarms which can be created and deleted. The index value 'N' is defined by 'sub10UnitMgmtAlarmsUserDefStart'. Any attempt to create or delete a row in the table with an index less than value of 'sub10UnitMgmtAlarmsUserDefStart' will be rejected. This table is indexed by alarm index a number ranging from 1 to the maximum number of entries in the alarm table. User defined alarm name and and alarm severity are configurable allowing multiple entries for the same alarm to be raised at different severity levels according to different threshold levels. A user defined alarm can be created with the same name as a fixed alarm if required. For example the fixed alarm 'Rx Power Low' monitors the radio receive power and raises an alarm if the value is less than a certain threshold. A user defined alarm may be created with the same name but a less stringent threshold and a lower seveirty level. This allows same alarms to be raised at increasing severity as the condition causing the alarm worsens. This table allows configuration of threshold passing behavior, threshold values for both raising and clearing the alarms and the perceived severity. The alarm forwarding mechanisms can be defined for example SNMP trap, syslog and SMTP. No validation of thresholds across different entries of the table therefore the administrator must ensure that thresholds are correctly set accordingly for the severity of each alarm. This is particularly important where a single alarm name is configured to be raised at different severity levels.")
