if mibBuilder.loadTexts: sub10UnitMgmtAlarmMonitorIntvl.setDescription('The interval in seconds when the measured object is to be read and compared with the raise and clear thresholds. An alarm cannot be raised or cleared quicker than the configured interval. Please also see related sub10UnitMgmtAlarmRaiseIntvls and sub10UnitMgmtAlarmClearIntvls objects which also affect when alarms are raised and cleared. This object should be set appropriately for the measured object to be monitored (see sub10UnitMgmtAlarmRaiseMeasObject) and the resulting alarm to be raised and cleared (see sub10UnitMgmtAlarmName). This also affects the forwarding of alarms for example as SNMP notifications. Higher severity alarms may have a shorter interval than those at a lower severity. The correct setting of sub10UnitMgmtAlarmMonitorIntvl and related objects sub10UnitMgmtAlarmRaiseIntvls and sub10UnitMgmtAlarmClearIntvls are important to avoid potential network loading caused by alarm storms.')
