if mibBuilder.loadTexts: sub10EthStats15mHistTable.setDescription("This table maintains a history of Ethernet statistics based on 15 minute intervals. There are a maximum of 96 intervals which represent 24 hours of data. This table along with the 1m and 1d tables provide a history of the performance of the radio interface. This information may then be post processed and used as a troubleshooting tool. An entry in the table represents a 15 minute interval where each interval is synchronised to the clock on the hour. There are up to 96 intervals starting at 1. The number of valid entries in the table is given by the value of sub10EthStats15mHistIntvls of which the minimum is 0 and the maximum is 96 therefore providing up to a maximum of 24 hours of 15 minute interval data. The first entry indexed by 1 represents the most recent completed 15 minute interval. At the end of each interval all entries of 'index' are copied into entry 'index+1'. If the number of valid intervals is 96 then the least recent interval entry is summarised into 24 hour stats and then discarded.")
